import './FoodFavorites.scss'
import FoodHeader from '../FoodHeader/FoodHeader';
import FoodItems from '../FoodItems/FoodItems';
import FoodFavoritesList from '../FoodFavoritesItems/FoodFavoritesItems';
import {useSelector} from 'react-redux';
const FoodFavorites=()=>{

const {favorite}=useSelector(store=>store.food)
const content =favorite?<FoodFavoritesList/>:<FoodItems/>;
  return(
    <>
    <FoodHeader/>
    {content}
    </>
    
  )
}
export default FoodFavorites;
